import React from 'react';

const ListUsers = ({ user }) => {

    console.log(user, 'from List user')
    const { name, age } = user;

    return (  
        <>
            <div>
                <div>
                    <h2>User Name { name }</h2>
                    <p>User Age {age}</p>
                </div>
            </div>
        </>
    );
}

export default ListUsers;
